  "criminalCharges" : [ { } ],
  "Broker Comment" : "ON OCTOBER 5, 1982, CRIMINAL INFORMATION WAS FILED IN THE U.S. DISTRICT COURT FOR THE SOUTHERN DISTRICT OF CALIFORNIA, IN THE MATTER ENTITLED \"UNITED STATES OF AMERICA VS. HOPSTER FENCE, INC., JAMES H. DAVID, AND RITA F. DAVID\", CASE #82-0763K. THE TWO COUNT INFORMATION ALLEGED: [COUNT 1] BETWEEN ON OR ABOUT 1979 AND JUNE 1981, IN THE SOUTHERN DISTRICT OF CALIFORNIA, DEFENDANT HOPSTER FENCE, WILFULLY AND KNOWINGLY DID BY THREAT OF DISMISSAL FROM EMPLOYEMENT, OR SOME OTHER MANNER, INDUCE PERSONS EMPLOYED ON CERTAIN CONTRACTS, WHICH CONTRACTS WERE FOR THE CONSTRUCTION, COMPLETION OR REPAIR OF A PUBLIC HOUSING OR WORKS, TO GIVE UP PART OF THE COMPENSATION TO WHICH THEY WERE ENTITLED UNDER THE CONTRACT OF EMPLOYMENT, ALL IN VIOLATION OF TITLE 18, U.S.C., SECTION 874; [COUNT 2] BETWEEN OR ABOUT FEBRUARY 1979 AND JUNE 1981, IN THE SOUTHERN DISTRICT OF CALIFORNIA, DEFENDANT RITA F. DAVID, WITH INTENT TO DEFRAUD, DID KNOWINGLY AND INTENTIONALLY MAKE AND CAUSE TO BE MADE FALSE REPORTS TO CERTAIN FEDERAL AGENCIES, INCLUDING THE U.S. DEPARTMENT OF HOUSING AND URBAN DEVELOPMENT, BY SUBMITTING FALSE CERTIFIED PAYROLLS FOR EMPLOYEES WORKING ON THE CONTRACTS REFERENCED IN COUNT 1, IN VIOLATION OF TITLE 18, U.S.C., SECTION 1012; AND DEFENDANT JAMES H. DAVID, AIDED AND ABETTED THE AFORESAID OFFENSE, IN VIOLATION OF TITLE 18, U.S.C., SECTION 2."
}
